import React from "react";
import "../styles/Home.css";

function Home() {
  return (
    <div className="mainBox">
      <div className="aboutMe">
        <div className="tag">About Me</div>
      </div>
      <div className="content">
        <p>I am a aspiring developer</p>
      </div>
    </div>
  );
}
export default Home;
